import React from 'react';
import Transaction from './Transaction';

const ListTransactions = () => {
    return (
        <div className='TransactionItemsList'>
            <h3>History</h3>
            <Transaction style={{ borderRight: "3px solid red", backgroundCo }} name="Cash out" amount={-400.00} />
            <Transaction name="Book Sold" amount={+100} />
            <Transaction name="Camera" amount={-50} />
            <Transaction name="Cash In" amount={+70} />
        </div>
    )
}


export default ListTransactions;
